    "3D Flash LIDAR EDL Resolution Improvement Project",nt"tracking_summary":
    {ntt"total": 2,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T01:21:16.584429",nt"name": "3d-flash-lidar-edl-resolution-improvement-project-691cc",nt"isopen":
    true,nt"url": null,nt"notes": "Advanced Scientific Concepts, Inc. (ASC)
    is a small business that has developed 3D Flash LIDAR systems for space and terrestrial
    applications.  3D Flash LIDAR is ideal for determining real-time spacecraft trajectory,
    speed and orientation to the planet's surface, as well as evaluating potential landing
    sites.   ASC's Flash LIDAR has been used for autonomous berthing with the International
    Space Station (ISS) and is currently under development for the OSIRIS-REx asteroid
    rendezvous mission.  Flash LIDAR is also being evaluated by JPL and NASA for Entry
    Decent and Landing (EDL) for ALHAT and Mars. Through the investigations at JPL and
    NASA Langley a number of improvements to the technology have been identified as
    beneficial to landing application.   Improved range resolution, spatial resolution,
    increased sensitivity and greater dynamic range would increase the functionality
    for successful landing operations. ASC has developed the core technology for Flash
    LIDAR with its 3D-FPA and is developing higher resolution arrays to address these
    concerns.  ASC currently has on hand high sensitivity 32x32 arrays (shuttle run
    for the 320x320) that have not been tested with detectors.  Initial evaluation suggests
    that they have increased sensitivity by 50x, spatial resolution by 2.5x, and range
    resolution by 3x.",nt"license_title": "U.S. Government Work",nt"extras":
